import './App.css';
import {BrowserRouter as Router, Route,Switch} from 'react-router-dom'
import LoginComponent from './components/login/login.component';

function App() {
  return (
    <Router>
      <h1>app.js component works. This will show up in all routers</h1>
      <Switch>
        <Route path ='/Login'>
          <LoginComponent/>
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
